/* eslint-disable import/no-anonymous-default-export */
import './Header.css';
import img04 from ''



export default() => { 
    return(
        <header id="inicio">

 
            <div className="topo">
                <h1>Agencia de Turismo Autoestima</h1>
            </div>
            
                <nav className="nav nav-pills flex-column flex-sm-row" Style="background-color: rgb(242, 255, 0)">
                    <a className="flex-sm-fill text-sm-center nav-link" aria-current="page" href="/index.html">Home</a>
                    <a className="flex-sm-fill text-sm-center nav-link" href="/destino.html">Destino</a>
                    <a className="flex-sm-fill text-sm-center nav-link" href="/compra.html">Compra</a>

                    <a className="flex-sm-fill text-sm-center nav-link" href="/sac.html">Sac</a>
            </nav>
            

        </header>


            );
            }
